using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;
using PushbulletSharp;
using PushbulletSharp.Models.Requests.Ephemerals;

namespace MasterBillList.Services
{
    public class PushbulletSender : IPushbulletSender
    {
        public PushbulletSender()
        {
        }
        public TwilioSenderOptions Options { get; } //set only via Secret Manager

        public Task SendEphemeralAsync(string apiKey, string encryptionKey, string message, string encryptionPassword = null)
        {
            return Execute(apiKey, encryptionKey, message, encryptionPassword);
        }

        public Task Execute(string apiKey, string encryptionKey, string message, string encryptionPassword = null)
        {
            PushbulletClient client = null;
            if(!String.IsNullOrEmpty(encryptionPassword))
            {
                client = new PushbulletClient(apiKey, encryptionPassword, TimeZoneInfo.Local);
                //userManager.SavePushbulletEncryptionKey(user, client.EncryptionKey);
            }
            else
            {
                client = new PushbulletClient(apiKey, TimeZoneInfo.Local);
                if(!String.IsNullOrEmpty(encryptionKey))
                {
                    client.EncryptionKey = encryptionKey;
                }
            }

            var currentUser = client.CurrentUsersInformation();
            var userDevices = client.CurrentUsersDevices(true);
            var firstActiveDevice = userDevices.Devices.FirstOrDefault();

            NotificationEphemeral notificationRequest = new NotificationEphemeral()
            {
                Title = "Notification Test",
                Body = "This is a notification from PushBulletSharp!",
                Dismissable = true,
                HasRoot = false,
                NotificationId = "123456789",
                NotificationTag = null,
                SourceDeviceIden = firstActiveDevice.Iden,
                SourceUserIden = currentUser.Iden,
                ApplicationName = "MasterBillList",
                Icon = "data:image/jpeg;base64,"
            };

            var result = client.PushEphemeral(notificationRequest, !String.IsNullOrEmpty(client.EncryptionKey));
            return Task.FromResult(true);
        }
    }
}
